import React from 'react';
import NavigationBar from '../components/Navbar';
import StocksList from '../components/StocksList';


function Stocks({ simulationRunning, stocks }) {
  return (
    <Router>
      <NavigationBar />
      <StocksList stocks={stocks} />
    </Router>
  );
}

console.log(stocks);

export default Stocks;
